import { createGlobalStyle } from "styled-components";

export const GlobalStyleAmin = createGlobalStyle`
*{
    font-family: 'Kanit', sans-serif;
    margin: 0;
}
.container{
    display: flex;
    margin-top: 10px;
}
.link{
    text-decoration: none;
    color: inherit;
}
`;
